  return (
    <Container maxW='xl' centerContent>
      <Box
      	display="flex"
      	justifyContent="center"
      	p={3}
      	bg={"bisque"}
      	w="100%"
      	m="40px 0 15px 0"
      >
      	<Text fontSize="4xl" fontFamily="Cursive" color="darkblue">GooberChat</Text>
      </Box>
      <Box bg={"bisque"}>

      </Box>
    </Container>
  );
}

export default Frontpage;
